        <td id="LC23" class="blob-code blob-code-inner js-file-line">/*! $AC$ PennController.newYoutube(name,url) Creates a new Youtube element with the specified URL $AC$$AC$ PennController.getYoutube(name) Retrieves an existing Youtube element $AC$$AC$ Youtube PElement.play() Starts playing the video (visible only if print was called) $AC$$AC$ Youtube PElement.pause() Pauses the video $AC$$AC$ Youtube PElement.print() Shows Youtube&#39;s video player $AC$$AC$ Youtube PElement.remove() Removes Youtube&#39;s video player $AC$$AC$ Youtube PElement.stop() Stops the video and goes back to the beginning $AC$$AC$ Youtube PElement.wait() Wait until the video reaches the end before proceeding $AC$$AC$ Youtube PElement.settings.disable() Disables the Youtube video player $AC$$AC$ Youtube PElement.settings.enable() Enables the Youtube video player (again) $AC$$AC$ Youtube PElement.settings.once() Will disable the Youtube video player after the video has played once $AC$$AC$ Youtube PElement.settings.log() Will log play and/or stop events in the results file $AC$$AC$ Youtube PElement.test.hasPlayed() Checks that the video has ever played through before $AC$$AC$ Youtube PElement.test.playing() Checks that the video is currently playing $AC$ */</td>
